/**
1871. 跳跃游戏 VII

给你一个下标从 0 开始的二进制字符串 s 和两个整数 minJump 和 maxJump 。一开始，你在下标 0 处，且该位置的值一定为 '0' 。当同时满足如下条件时，你可以从下标 i 移动到下标 j 处：

i + minJump <= j <= min(i + maxJump, s.length - 1) 且
s[j] == '0'.
如果你可以到达 s 的下标 s.length - 1 处，请你返回 true ，否则返回 false 。

条件：
2 <= s.length <= 105
s[i] 要么是 '0' ，要么是 '1'
s[0] == '0'
1 <= minJump <= maxJump < s.length


来源：力扣（LeetCode）
链接：https://leetcode-cn.com/problems/jump-game-vii



 */
class Solution_1871 {

    fun canReach(s: String, minJump: Int, maxJump: Int): Boolean {
        if (!s.endsWith('0')) {
            return false
        }
        val canJumpArr = BooleanArray(s.length)
        canJumpArr[0] = true
        var limit = 0
        s.forEachIndexed { index, c ->
            if (canJumpArr[index] == false) {
                return@forEachIndexed
            }
            val left = Math.max(limit, index + minJump)
//            val left = index + minJump
            val right = Math.min(s.length - 1, index + maxJump)

            if (left < s.length) {
                for (j in left..right) {
                    if (s[j] == '0') {
                        canJumpArr[j] = true
                    }
                }
            }
            limit = right + 1
        }
        return canJumpArr[s.length - 1]
    }

    fun canReach2(s: String, minJump: Int, maxJump: Int): Boolean {
        if (!s.endsWith('0')) {
            return false
        }
        val canJumpSet = mutableListOf<Int>()
        val canJumpArr = BooleanArray(s.length)
        canJumpArr[0] = true
        s.forEachIndexed { index, c ->
            val left = index + minJump
            val right = index + maxJump

            if (left < s.length) {
                for (j in left..Math.min(s.length - 1, right)) {
                    if (s[j] == '0') {
                        canJumpArr[j] = true
                    }
                }
            }
        }
        return canJumpArr[s.length - 1]
    }


    fun canReach1(s: String, minJump: Int, maxJump: Int): Boolean {
        if (!s.endsWith('0')) {
            return false
        }
        val canJumpSet = LinkedHashSet<Int>()
        s.forEachIndexed { index, c ->
            if (c == '0') {
                canJumpSet.add(index)
            }
        }
        val map = canReach(canJumpSet, 0, minJump, maxJump)
        return map.get(s.length - 1) ?: false
    }

    fun canReach(canJumpList: LinkedHashSet<Int>, curIndex: Int, minJump: Int, maxJump: Int): Map<Int, Boolean> {
        val map = mutableMapOf<Int, Boolean>()
        if (curIndex == canJumpList.size - 1) {
            map[curIndex] = true
        } else {
            map[0] = true
            canJumpList.forEachIndexed { index, i ->
                if (map[i] != true) {
                    return@forEachIndexed
                }
                val minValue = i + minJump
                val maxValue = i + maxJump
                for (j in minValue..Math.min(maxValue, canJumpList.last())) {
                    if (canJumpList.contains(j)) {
                        map[j] = true
                    }
                }
            }
        }
        return map
    }

